#!/bin/sh
#

prog="ButterworthFilter_test"
tmp=/tmp/$$
here=`pwd`
bin=$here/bin

# Sanity checks
if [ $? -ne 0 ]; then echo "Failed pwd"; exit 1; fi
if [ ! -f $bin/$prog ] ; then echo "Didnt find "$prog; exit 2; fi

fail()
{
        echo FAILED $0 $prog 1>&2
        cd $here
        rm -rf $tmp
        exit 1
}

pass()
{
        echo PASSED $0 $prog
        cd $here
        rm -rf $tmp
        exit 0
}

trap "fail" 1 2 3 15
mkdir -p $tmp
if [ $? -ne 0 ]; then echo "Failed mkdir"; exit 1; fi
cd $tmp
if [ $? -ne 0 ]; then echo "Failed cd"; fail; fi

#
# the output should look like this
#
cat > test.ok << 'EOF'
Allowed options:
 --help                 produce help message
 --high_pass_LN         use high pass low-noise order 2
 --high_pass_GM         use high pass Gray-Markel order 3
 --high_pass_LS         use high pass Stoyanov order 3
 --seconds arg          seconds to read
 --cutoff arg           cutoff frequency
 --inFile arg           read from wav file
 --outFile arg          write to wav file
EOF
if [ $? -ne 0 ]; then echo "Failed output cat"; fail; fi

#
# run and see if the results match
#
args="--help"
echo "Running $prog $args"
$VALGRIND_CMD $bin/$prog $args > test.out 2>&1
diff test.ok test.out
if [ $? -ne 0 ]; then echo "Failed diff"; fail; fi

#
# the input looks like this
#
# Constructed in octave with:
#  n=rand(N,1)-0.5;
#  n=0.5*n/std(n);
#
